const handleSubmit = async (code) => {
  try {
    const response = await fetch("http://127.0.0.1:5000/api/parse-code", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ code }),
    });

    const data = await response.json();
    setParsedOutput(JSON.stringify(data, null, 2)); // Ensure valid JSON string
  } catch (err) {
    console.error("Error:", err);
    setParsedOutput(JSON.stringify({ error: "Failed to fetch data from the backend." }));
  }
};
